        public void solve() {
            char[] s = new char[1000000];
            int n = io.readString(s, 0);

            KMPAutomaton kmp = new KMPAutomaton(n);
            KMPAutomaton inv = new KMPAutomaton(n);
            for (int i = 0; i < n; i++) {
                kmp.build(s[i]);
                inv.build(s[n - i - 1]);
            }
            int p = n - kmp.fail[n];
            if (n % p != 0) {
                p = n;
            }

            if (p == 1) {
                answer(n, 1);
                return;
            }
            if (p == n) {
                answer(1, 1);
                return;
            }
            int cnt = 0;
            for (int i = 2; i <= n; i++) {
                int p1 = i - 1 - kmp.fail[i - 1];
                int p2 = (n + 1 - i) - inv.fail[n + 1 - i];

                boolean f1 = p1 == (i - 1) || (i - 1) % p1 != 0;
                boolean f2 = p2 == (n + 1 - i) || (n + 1 - i) % p2 != 0;
                if (f1 && f2) {
                    cnt++;
                }
            }

            answer(2, cnt);
        }

        public void answer(int len, int cnt) {
            io.cache.append(len).append('\n').append(cnt);
        }

    }

    public static class KMPAutomaton {
        char[] data;
        int[] fail;
        int buildLast;
        int matchLast = 0;
        int length;

        public KMPAutomaton(int cap) {
            data = new char[cap + 2];
            fail = new int[cap + 2];
            fail[0] = -1;
            buildLast = 0;
            length = cap;
        }

        public KMPAutomaton(KMPAutomaton automaton) {
            data = automaton.data;
            fail = automaton.fail;
            buildLast = automaton.buildLast;
            length = automaton.length;
        }

        public boolean isMatch() {
            return matchLast == length;
        }

        public int length() {
            return length;
        }

        public void beginMatch() {
            matchLast = 0;
        }

        public void match(char c) {
            matchLast = visit(c, matchLast) + 1;
        }

        public int visit(char c, int trace) {
            while (trace >= 0 && data[trace + 1] != c) {
                trace = fail[trace];
            }
            return trace;
        }

        public void build(char c) {
            buildLast++;
            fail[buildLast] = visit(c, fail[buildLast - 1]) + 1;
            data[buildLast] = c;
        }

    }


    public static class FastIO {
        public final StringBuilder cache = new StringBuilder(1 << 13);
        private final InputStream is;
        private final OutputStream os;
        private final Charset charset;
        private StringBuilder defaultStringBuf = new StringBuilder(1 << 13);
        private byte[] buf = new byte[1 << 13];
        private int bufLen;
        private int bufOffset;
        private int next;

        public FastIO(InputStream is, OutputStream os, Charset charset) {
            this.is = is;
            this.os = os;
            this.charset = charset;
        }

        public FastIO(InputStream is, OutputStream os) {
            this(is, os, Charset.forName("ascii"));
        }

        private int read() {
            while (bufLen == bufOffset) {
                bufOffset = 0;
                try {
                    bufLen = is.read(buf);
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
                if (bufLen == -1) {
                    return -1;
                }
            }
            return buf[bufOffset++];
        }

        public void skipBlank() {
            while (next >= 0 && next <= 32) {
                next = read();
            }
        }

        public int readInt() {
            int sign = 1;

            skipBlank();
            if (next == '+' || next == '-') {
                sign = next == '+' ? 1 : -1;
                next = read();
            }

            int val = 0;
            if (sign == 1) {
                while (next >= '0' && next <= '9') {
                    val = val * 10 + next - '0';
                    next = read();
                }
            } else {
                while (next >= '0' && next <= '9') {
                    val = val * 10 - next + '0';
                    next = read();
                }
            }

            return val;
        }

        public long readLong() {
            int sign = 1;

            skipBlank();
            if (next == '+' || next == '-') {
                sign = next == '+' ? 1 : -1;
                next = read();
            }

            long val = 0;
            if (sign == 1) {
                while (next >= '0' && next <= '9') {
                    val = val * 10 + next - '0';
                    next = read();
                }
            } else {
                while (next >= '0' && next <= '9') {
                    val = val * 10 - next + '0';
                    next = read();
                }
            }

            return val;
        }

        public double readDouble() {
            boolean sign = true;
            skipBlank();
            if (next == '+' || next == '-') {
                sign = next == '+';
                next = read();
            }

            long val = 0;
            while (next >= '0' && next <= '9') {
                val = val * 10 + next - '0';
                next = read();
            }
            if (next != '.') {
                return sign ? val : -val;
            }
            next = read();
            long radix = 1;
            long point = 0;
            while (next >= '0' && next <= '9') {
                point = point * 10 + next - '0';
                radix = radix * 10;
                next = read();
            }
            double result = val + (double) point / radix;
            return sign ? result : -result;
        }

        public String readString(StringBuilder builder) {
            skipBlank();

            while (next > 32) {
                builder.append((char) next);
                next = read();
            }

            return builder.toString();
        }

        public String readString() {
            defaultStringBuf.setLength(0);
            return readString(defaultStringBuf);
        }

        public int readLine(char[] data, int offset) {
            int originalOffset = offset;
            while (next != -1 && next != '\n') {
                data[offset++] = (char) next;
                next = read();
            }
            return offset - originalOffset;
        }

        public int readString(char[] data, int offset) {
            skipBlank();

            int originalOffset = offset;
            while (next > 32) {
                data[offset++] = (char) next;
                next = read();
            }

            return offset - originalOffset;
        }

        public int readString(byte[] data, int offset) {
            skipBlank();

            int originalOffset = offset;
            while (next > 32) {
                data[offset++] = (byte) next;
                next = read();
            }

            return offset - originalOffset;
        }

        public char readChar() {
            skipBlank();
            char c = (char) next;
            next = read();
            return c;
        }

        public void flush() throws IOException {
            os.write(cache.toString().getBytes(charset));
            os.flush();
            cache.setLength(0);
        }

        public boolean hasMore() {
            skipBlank();
            return next != -1;
        }
    }

